        Kc_s[9*npt+i] = refC * exp((g_RT[22*npt+i]) - (g_RT[0*npt+i] + g_RT[21*npt+i]));
        Kc_s[10*npt+i] = refCinv * exp((g_RT[0*npt+i] + g_RT[27*npt+i]) - (g_RT[29*npt+i]));
