        Kc_s[16*npt+i] = refCinv * exp((g_RT[0*npt+i] + g_RT[23*npt+i]) - (g_RT[24*npt+i]));
        Kc_s[17*npt+i] = refCinv * exp((g_RT[0*npt+i] + g_RT[24*npt+i]) - (g_RT[25*npt+i]));
        Kc_s[18*npt+i] = refCinv * exp((g_RT[22*npt+i] + g_RT[24*npt+i]) - (g_RT[49*npt+i]));
        Kc_s[19*npt+i] = refCinv * exp((g_RT[0*npt+i] + g_RT[34*npt+i]) - (g_RT[36*npt+i]));
